import React from 'react'
import { Link, } from 'react-router-dom'

const Links = [
    { to: "/", text: 'Home' },
    {to:"/starred",text:"Stareed"}
]


const Navigation = () => {
  return (
      <div>
          <ul>
              {
                  Links.map(item => <Link key={item.text} to={item.to}>{ item.text}</Link>)
              }
          </ul>
    </div>
  )
}

export default Navigation